INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24001, 2, 2, 0.0, "2030/12/17 14:59:59", 102301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 2.21, 24002, 1, 2, 0.0, "2030/12/17 14:59:59", 102301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24003, 2, 2, 0.0, "2030/12/17 14:59:59", 102301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 0.0, 24, 10046, "2020/07/31 12:00:00", 1.99, 24004, 2, 1, 0.0, "2030/12/17 14:59:59", 192201);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 0.0, 24, 10046, "2020/07/31 12:00:00", 2.21, 24005, 1, 2, 0.0, "2030/12/17 14:59:59", 192201);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 0.0, 24, 10046, "2020/07/31 12:00:00", 3.33, 24006, 2, 1, 0.0, "2030/12/17 14:59:59", 192201);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24007, 2, 2, 0.0, "2030/12/17 14:59:59", 192301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 0.0, 24, 10046, "2020/07/31 12:00:00", 2.68, 24008, 1, 2, 0.0, "2030/12/17 14:59:59", 192301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24009, 2, 2, 0.0, "2030/12/17 14:59:59", 192301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (501, "やった！", "", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24010, 1, 1, 0.0, "2030/12/17 14:59:59", 192501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (502, "勝ったよ！", "", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24011, 1, 1, 0.0, "2030/12/17 14:59:59", 192501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (503, "いい調子！", "", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24012, 1, 1, 0.0, "2030/12/17 14:59:59", 192501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 0.0, 24, 10046, "2020/07/31 12:00:00", 5.33, 24013, 6, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 0.0, 24, 10046, "2020/07/31 12:00:00", 6.85, 24014, 1, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 0.0, 24, 10046, "2020/07/31 12:00:00", 3.0, 24015, 1, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 0.0, 24, 10046, "2020/07/31 12:00:00", 6.11, 24016, 1, 2, 0.0, "2030/12/17 14:59:59", 192401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 0.0, 24, 10046, "2020/07/31 12:00:00", 6.75, 24017, 1, 2, 0.0, "2030/12/17 14:59:59", 192401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24018, 2, 2, 0.0, "2030/12/17 14:59:59", 192401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 4.52, 24019, 2, 1, 0.0, "2030/12/17 14:59:59", 113401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 3.89, 24020, 2, 1, 0.0, "2030/12/17 14:59:59", 113401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 13.49, 24021, 1, 2, 0.0, "2030/12/17 14:59:59", 113401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 0.0, 24, 10046, "2020/07/31 12:00:00", 3.17, 24022, 1, 2, 0.0, "2030/12/17 14:59:59", 106501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 0.0, 24, 10046, "2020/07/31 12:00:00", 4.42, 24023, 1, 2, 0.0, "2030/12/17 14:59:59", 106501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 0.0, 24, 10046, "2020/07/31 12:00:00", 2.89, 24024, 6, 1, 0.0, "2030/12/17 14:59:59", 106501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 0.0, 24, 10046, "2020/07/31 12:00:00", 3.71, 24025, 4, 3, 0.0, "2030/12/17 14:59:59", 102301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 0.0, 24, 10046, "2020/07/31 12:00:00", 5.1, 24026, 2, 1, 0.0, "2030/12/17 14:59:59", 192201);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 0.0, 24, 10046, "2020/07/31 12:00:00", 4.34, 24027, 1, 3, 0.0, "2030/12/17 14:59:59", 192301);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (521, "いい勝負だったよ\nまたやろうね", "", 0.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24028, 1, 1, 0.0, "2030/12/17 14:59:59", 192501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", -360.0, 24, 10046, "2020/07/31 12:00:00", 5.62, 24029, 1, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", -360.0, 24, 10046, "2020/07/31 12:00:00", 9.58, 24030, 1, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", -360.0, 24, 10046, "2020/07/31 12:00:00", 0.0, 24031, 2, 2, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", -360.0, 24, 10046, "2020/07/31 12:00:00", 9.13, 24032, 2, 1, 0.0, "2030/12/17 14:59:59", 113501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", -360.0, 24, 10046, "2020/07/31 12:00:00", 8.27, 24033, 1, 2, 0.0, "2030/12/17 14:59:59", 113501);
